use jobFinder;

drop table MOCK_DATA; 

create table MOCK_DATA (
	id INT,
	title TEXT,
	description TEXT,
	employment_type VARCHAR(9),
	job_level VARCHAR(26),
	salary VARCHAR(50),
	application_deadline DATE,
	industry VARCHAR(50),
	address VARCHAR(50),
	city VARCHAR(50),
	country VARCHAR(50),
	educational_attainment TEXT,
	skill TEXT,
	work_experience TEXT
);
